import React from "react";
import "../App.css";

function About() {
  return (
    <div className="about">
      <h1>About Page</h1>
      <p>#Made by YASH JHAVERI!!</p>
      <p>Follow me on <a href="https://github.com/yashjhaveri05">GitHub</a> and <a href="https://www.linkedin.com/in/yash-jhaveri-3b0882192/">LinkedIn</a></p>
    </div>
  );
}

export default About;
